<html>
  <head>
    <style>
      #root .hud {
        width: 0;
        height: 0;
      }

      #root .hud > .menu {
        position: fixed;
        top: 1em;
        left: 1em;
        transition: color 100ms ease-out;
        cursor: pointer;
      }

      #root .hud > .menu:hover {
        color: white;
      }

      #root .hud > .menu-overlay {
        position: fixed;
        top: 3em;
        left: 1em;
      }

      #root .hud > .menu-overlay.hidden {
        display: none;
      }

      #root .hud > .title {
        position: fixed;
        top: 0.9em;
        left: 3em;
        color: white;
      }

      #root .hud > .title h2 {
        font-size: 1.3em;
      }

      #root .hud > .login-item {
        position: fixed;
        top: 1em;
        right: 1em;
        color: white;
        text-decoration: underline;
        cursor: pointer;
      }

      #root .hud > .login-item:hover {
        color: teal;
      }

      #root .hud > .nft-details-item {
        position: fixed;
        top: calc(50% - 1em);
        left: calc(50% - 1em);
      }

      #root .hud > .nft-details-item.hidden {
        display: none;
      }

      #root .hud > .register-overlay,
      #root .hud > .login-overlay,
      #root .hud > .mint-overlay,
      #root .hud > .details-overlay {
        position: fixed;
        top: 0;
        left: 0;
        right: 0;
        bottom: 0;
        display: flex;
        justify-content: center;
        align-items: center;
      }

      #root .hud > .register-overlay > .form,
      #root .hud > .login-overlay > .form,
      #root .hud > .mint-overlay > .form,
      #root .hud > .details-overlay > .form {
        background-color: white;
        width: 30em;
        padding: 1em;
        border-radius: 1em;
        box-shadow: rgba(0, 0, 0, 0.25) 0 0 1em 0;
      }

      #root .hud > .register-overlay.hidden,
      #root .hud > .login-overlay.hidden,
      #root .hud > .mint-overlay.hidden,
      #root .hud > .details-overlay.hidden {
        display: none;
      }

      #root .hud > .details-overlay > .form {
        width: 80em;
      }

      #root .hud > .details-overlay .nft-image {
        width: 100%;
        object-fit: contain;
      }

      #root .hud > .details-overlay .ui.list .item .title {
        font-weight: bold;
      }
    </style>
    <link rel="stylesheet" href="https://cdn.jsdelivr.net/npm/semantic-ui@2.4.2/dist/semantic.min.css">
    <script
      src="https://code.jquery.com/jquery-3.1.1.min.js"
      integrity="sha256-hVVnYaiADRTO2PzUGmuLJr8BLUSjGIZsDYGmIJLv2b8="
      crossorigin="anonymous"></script>
    <script src="https://cdn.jsdelivr.net/npm/semantic-ui@2.4.2/dist/semantic.min.js"></script>
  </head>
  <body>
    <div id="root" style="position: absolute; top: 0; left: 0; right: 0; bottom: 0;">
      <div class="hud">

        <!-- HUD Menu Button and Overlay - Top Left -->
        <div class="menu">
          <i class="bars icon"></i>
        </div>
        <div class="menu-overlay hidden">
          <div class="ui vertical menu">
            <a class="item" id="login-menu-item">
              Login
            </a>
            <a class="item" id="register-menu-item">
              Register
            </a>
            <a class="item" id="mint-menu-item">
              Mint
            </a>
          </div>
        </div>

        <!-- HUD Title - Top Left -->
        <div class="title">
          <h2>
            Chiba Gallery
          </h2>
        </div>

        <!-- HUD Item For Login - Top Right -->
        <div class="login-item">
          Login
        </div>

        <!-- HUD View Details Icon - Centre -->
        <div class="nft-details-item hidden">
          <i class="inverted eye icon"></i>
        </div>

        <!-- Registration Overlay -->
        <div class="register-overlay hidden">
          <div class="form ui one column grid">
            <div class="column">
              <h2 class="ui header">
                Register
              </h2>
            </div>
            <div class="column">
              <div class="ui left corner labeled fluid input">
                <input type="text" placeholder="Name">
                <div class="ui left corner label">
                  <i class="asterisk icon"></i>
                </div>
              </div>
            </div>
            <div class="column">
              <div class="ui left corner labeled fluid input">
                <input type="password" placeholder="Password">
                <div class="ui left corner label">
                  <i class="asterisk icon"></i>
                </div>
              </div>
            </div>
            <div class="right aligned column">
              <button class="ui primary button" name="register">
                Register
              </button>
              <button class="ui button" name="cancel">
                Cancel
              </button>
            </div>
          </div>
        </div>

        <!-- Login Overlay -->
        <div class="login-overlay hidden">
          <div class="form ui one column grid">
            <div class="column">
              <h2 class="ui header">
                Login
              </h2>
            </div>
            <div class="column">
              <div class="ui left corner labeled fluid input">
                <input type="text" placeholder="Name">
                <div class="ui left corner label">
                  <i class="asterisk icon"></i>
                </div>
              </div>
            </div>
            <div class="column">
              <div class="ui left corner labeled fluid input">
                <input type="password" placeholder="Password">
                <div class="ui left corner label">
                  <i class="asterisk icon"></i>
                </div>
              </div>
            </div>
            <div class="right aligned column">
              <button class="ui primary button" name="login">
                Login
              </button>
              <button class="ui button" name="cancel">
                Cancel
              </button>
            </div>
          </div>
        </div>

        <!-- Minting NFT Overlay -->
        <div class="mint-overlay hidden">
          <div class="form ui one column grid">
            <div class="column">
              <h2 class="ui header">
                Mint
              </h2>
            </div>
            <div class="column">
              <div class="ui left corner labeled fluid input">
                <input type="file" placeholder="Image" name="image">
                <div class="ui left corner label">
                  <i class="asterisk icon"></i>
                </div>
              </div>
            </div>
            <div class="column">
              <div class="ui left corner labeled fluid input">
                <input type="text" placeholder="Name" name="name">
                <div class="ui left corner label">
                  <i class="asterisk icon"></i>
                </div>
              </div>
            </div>
            <div class="right aligned column">
              <button class="ui primary button" name="mint">
                Mint
              </button>
              <button class="ui button" name="cancel">
                Cancel
              </button>
            </div>
          </div>
        </div>

        <!-- NFT Details Overlay -->
        <div class="details-overlay hidden">
          <div class="form ui grid">
            <div class="sixteen wide column">
              <h2 class="ui header">
                Details
              </h2>
            </div>
